/**
 * You might find it useful to have some dummy data for your own testing.
 * Feel free to write this function if you find that feature desirable.
 * 
 * When you come to office hours for help, we will ask you if you have written
 * this function and tested your project using it.
 */
import { ICalculateGrades } from "../types/api_types";
import { DataGrid, GridColDef } from "@mui/x-data-grid";
export function dummyData() {
  return [];
}

/**
 * This is the component where you should write the code for displaying the
 * the table of grades.
 *
 * You might need to change the signature of this function.
 *
 */
export const GradeTable = ({data}: {data : ICalculateGrades[]}) => {
  const rows = data;
  const rowsWithId = rows.map((row, index) => ({...row, id: index}));
  const columns : GridColDef[] = [
    { field: 'studentId', headerName: 'Student ID' },
    { field: 'studentName', headerName: 'Student Name' },
    { field: 'classId', headerName: 'Class ID' },
    { field: 'className', headerName: 'Class Name' },
    { field: 'semester', headerName: 'Semester' },
    { field: 'finalGrade', headerName: 'Final Grade' },
  ];
  return <DataGrid
    rows={rowsWithId}
    columns={columns}
    />;
};
